import React from "react";

function How() {
  return (
    <div className="how">
      <div className="container-how">
        <div className="item-how">
          <h2>Order</h2>
        </div>
        <div className="item-how">
          <h2>Pay</h2>
        </div>
        <div className="item-how">
          <h2>Delivery</h2>
        </div>
      </div>
    </div>
  );
}

export default How;
